class Creature:
    """Virtual creature with basic life attributes. Requires Bcolors class."""
    def __init__(self, name, type_creature, alive=True, sick=False, age=0, max_hunger=100, max_energy=100, max_happiness=100, max_health=100, hunger=None, energy=None, happiness=None, health=None):
        self.name = name
        self.type = type_creature  # This will be saved but NOT passed in kwargs
        self.alive = alive
        self.sick = sick
        self.age = age

        self.max_hunger = max_hunger
        self.max_energy = max_energy
        self.max_happiness = max_happiness
        self.max_health = max_health

        self.hunger = hunger if hunger is not None else self.max_hunger // 2
        self.energy = energy if energy is not None else self.max_energy // 2
        self.happiness = happiness if happiness is not None else self.max_happiness // 2
        self.health = health if health is not None else self.max_health

        self.healthDecayValue = lambda: 5 + self.age // 1  # Not saved to JSON

    ################################################################
    #########################    action    #########################
    ################################################################

    def eat(self, value):
        """Increase hunger and slightly decrease health due to overeating."""
        self.hunger = self.hunger + value
        self.health = self.health - value // 2
        print(f"{self.name} mange a pleines dents!")
        print(f"{bcolors.lightgreen}+{value} nourriture{bcolors.reset}")
        print(f"{bcolors.lightred}-{value // 2} sante{bcolors.reset}")
        return True

    def sleep(self, value):
        """Restore energy while slightly decreasing hunger."""
        self.energy = self.energy + value
        self.hunger = self.hunger - value // 2
        print(f"{self.name} fait un bon dodo!")
        print(f"{bcolors.lightgreen}+{value} energie{bcolors.reset}")
        print(f"{bcolors.lightred}-{value // 2} nourriture{bcolors.reset}")
        return True

    def play(self):
        """Increase happiness but decrease energy."""
        if self.energy > 10:
            self.happiness = self.happiness + 20
            self.energy -= 10
            print(f"{self.name} s'amuse comme un fou!")
            print(f"{bcolors.lightgreen}+20 bonheur{bcolors.reset}")
            print(f"{bcolors.lightred}-10 energie{bcolors.reset}")
            return True
        else:
            print(f"{self.name} est trop fatigue pour jouer.")
            return False

    def heal(self,value):
        """Heals the creature, removing sickness if possible."""
        if self.health < self.max_health:
            self.health = self.health + value
            print(f"{self.name} se sent revigore!")
            print(f"{bcolors.lightgreen}+{value} sante{bcolors.reset}")
            if self.sick:
                self.sick = False
                print(f"{bcolors.cyan}{self.name} n'est plus malade!{bcolors.reset}")
            return True
        else:
            print(f"{self.name} est deja en pleine forme !")
            return False

    #################################################################
    ########################    lifecycle    ########################
    #################################################################

    def growOld(self):
        """Increase age and decrease health depending of the age."""
        self.health -= self.healthDecayValue()
        self.age += 0.4

    def regulateStats(self):
        """Ensure stats remain within allowed limits."""
        self.hunger = min(self.hunger, self.max_hunger)
        self.energy = min(self.energy, self.max_energy)
        self.happiness = min(self.happiness, self.max_happiness)
        self.health = min(self.health, self.max_health)
        if self.sick:
            self.health -= 10
            self.happiness -= 10

    def randomEvent(self):
        """Trigger random life events that affect the creature's state."""
        randomEvent = random.randint(0,4)

        match (randomEvent):
            case 0: # maladie
                self.sick = True
                self.happiness -= 20
                print(f"{bcolors.yellow}Oh non ! {self.name} est tombe malade !{bcolors.reset}")
                print(f"{bcolors.lightred}-20 bonheur{bcolors.reset}")
            case 1: # rencontre amicale
                self.happiness += 15
                print(f"{bcolors.cyan}{self.name} a rencontre un nouvel ami et est heureux !{bcolors.reset}")
                print(f"{bcolors.lightgreen}+15 bonheur{bcolors.reset}")
            case 2: # météo défavorable
                self.energy -= 15
                self.happiness -= 5
                print(f"{bcolors.yellow}La meteo est mauvaise, {self.name} est fatigue.{bcolors.reset}")
                print(f"{bcolors.lightred}-15 energie{bcolors.reset}")
                print(f"{bcolors.lightred}-5 bonheur{bcolors.reset}")
            case 3: # trésor trouvé
                self.happiness += 25
                print(f"{bcolors.cyan}{self.name} a trouve un tresor, quelle chance !{bcolors.reset}")
                print(f"{bcolors.lightgreen}+25 bonheur{bcolors.reset}")
            case 4: # creature actuelle voit la sauvegarde d'une autre creature (possible uniquement si une autre sauvegarde existe)
                otherCreatures = [f[:-5] for f in os.listdir() if f.endswith(".json")]
                if otherCreatures:
                    self.happiness -= 25
                    print(f"{bcolors.lightgrey}{self.name} trouve le corps cryogenise de {random.choice(otherCreatures)}.{bcolors.reset}")
                    print(f"{bcolors.lightred}-25 bonheur{bcolors.reset}")

    ################################################################
    #########################    visual    #########################
    ################################################################


    def showStats(self):
        """Print the current stats of the creature."""
        print(f"\n{bcolors.yellow if self.sick else ''}{self.name}{bcolors.reset if self.sick else ''} ({self.type}) - Age: {self.age:.1f}")
        print(f"Nourriture: {self.hunger:.0f}/{self.max_hunger:.0f} | Energie: {self.energy:.0f}/{self.max_energy:.0f} | Bonheur: {self.happiness:.0f}/{self.max_happiness:.0f} | Sante: {self.health:.0f}/{self.max_health:.0f}")

    def checkCondition(self):
        """Determine if the creature is still alive and warns the user if necessary."""
        sentenceEnding = "\nPeut-être auriez-vous dû mieux vous en occuper.."
        if self.hunger<=0:
            self.alive = False
            print(f"{bcolors.red}La faim ayant ronge {self.name} sur de longues semaines, vous ne retrouvez qu'un corps squelettique.{sentenceEnding}{bcolors.reset}")
        elif self.energy <=0:
            self.alive = False
            print(f"{bcolors.red}Beaucoup trop fatigue pour effectuer le moindre geste, {self.name} s'effondre sous vos yeux.{sentenceEnding}{bcolors.reset}")
        elif self.happiness <=0:
            self.alive = False
            print(f"{bcolors.red}Vous retrouvez {self.name} au bout d'une corde.{sentenceEnding}{bcolors.reset}")
        elif self.health<=0:
            self.alive = False
            if self.healthDecayValue()>20:
                print(f"{bcolors.red}Il semblerait que, malgre tous vos efforts, {self.name} ne restera pas eternellement avec vous.{bcolors.reset}")
            elif self.sick:
                print(f"{bcolors.red}\"Ce n'est qu'un petit rhume\" pensiez vous.{sentenceEnding}{bcolors.reset}")
            else:
                print(f"{bcolors.red}{self.name} comptait sur vous.{sentenceEnding}{bcolors.reset}")
        else:
            if self.hunger <= 20:
                print(f"{bcolors.orange}{self.name} a faim.{bcolors.reset}")
            if self.energy <= 20:
                print(f"{bcolors.orange}{self.name} est fatigue.{bcolors.reset}")
            if self.happiness <= 20:
                print(f"{bcolors.orange}{self.name} ne se sent pas bien.{bcolors.reset}")
            if self.health <= 20:
                print(f"{bcolors.orange}{self.name} a besoin de soins.{bcolors.reset}")
    
